        "cumulative_count": "Nombre cumulé",
        "disagreement": "Désaccord",
        "disagreement_count": "Nombre de désaccords",
        "explanation": "<p>\n  Si, pour une raison quelconque, un utilisateur n’est pas d’accord avec le taxon de la communauté,\n  il peut le rejeter, ce qui veut dire que son ID sera celui utilisé pour\n  faire le lien avec les autres observations, mettre à jour les listes de vie, etc. Cela veut aussi\n  dire que ses observations ne peuvent devenir de niveau recherche que quand\n  la communauté est d’accord avec elles.\n</p>\n<p>\n  Toutefois, l’ID de la communauté reste affiché, afin que tous puissent voir les\n  différents IDs qui ont été proposés.\n</p>",
        "identification_count": "Nombre d’identifications",
        "opt_in_for_this_observation": "Choisir cette observation",
        "score": "Résultat",
        "you_have_opted_out": "Vous avez choisi de ne pas recevoir les identifications de la communauté",
        "your_id_does_not_match": "Votre ID (<span class=\"bold\">%{taxon_name}</span>) ne correspond pas à l'ID communautaire"
