        "explanation": "<p>\n如果由于某种原因用户不同意社区分类，他们可以拒绝它，这意味着他们的ID只能用于链接到其他观察，更新生物清单等。这也意味着他们的观察只能在当社区同意的时候才可以达到研究级别。\n</p>\n<p>\n但是，社区ID仍会被显示，因此所有人都可以看到已建议的不同ID。\n</p>",
