      "show": {
        "ancestor_disagreements_desc": "在分类单元的祖先中确定的分类群的编号，它在使用该分类单元进行第一次识别后创建的",
        "community_taxon_desc_html": "<p class=\"ui\">\n社区分类单元（或社区标识）表示%{site_name}社区认为在观察中描述的分类单元。如果您对我们如何选择社区分类感兴趣，请参阅下面算法的注释，但一般情况下，我们会尝试<strong>选择超过2/3标识符的分类</strong>。有时这意味着选择一个包含许多不同意类群的更高级别的分类单元（例如，你认为它是一个kingsnake，我认为它是响尾蛇，所以iNat选择能够包含所有蛇的亚目Serpentes）。该算法也略微支持异议，因为我们发现反对者通常是正确的。\n</p>\n<p class=\"ui\">\n社区分类单元是我们在与数据合作伙伴共享观察时使用的分类单元，将相同分类单元的观察链接在网站上，更新您的生活列表等。如果由于某种原因您不同意社区分类单元，您可以拒绝它，这意味着您的ID只能用于链接到其他观察，更新生物清单等。这也意味着只有当社区同意<em>您</em>时，您的观察才能被评为研究级别。如果您不喜欢社区分类群的整体想法，可以通过<a href=\"/users/edit\" target=\"_blank\">修改设置</a>来完全退出。\n</p>\n<p class=\"ui\">\n<strong>算法：</strong>对于所有已识别的分类群和包含它们的分类群（例如，属<i>Homo</i>包含<i>Homo sapiens</i>），将每个分类作为该分类单元的累计ID数量超过累积ID的总和，在该分类单元的第一个ID之后添加的更保守的ID数量，以及完全不同的ID数量（即，不包含分类单元的分类单元的ID得分）。对于分数超过2/3且至少有2个标识的已识别分类群，请选择排名最低的分类单元。\n</p>",
        "cumulative_count_desc": "单个分类单元及其所有后代的标识号",
        "disagreement_count_desc": "不属于同一分类单元祖先的已确定的分类群数量",
        "identification_count_desc": "单个分类单元的标识数量",
        "quality_assessment_help_html": "<p>\n  数据质量评估是观察准确性的总结。所有观察均以<strong>“随意”</strong>级别开始，并在以下情形时变更为<strong>“需要ID”</strong>级别：\n</p>\n\n<ul>\n  <li>此观察<strong>具有日期</strong></li>\n  <li>此观察<strong>有地理位置定位</strong>（即，有经纬度信息）</li>\n  <li>此观察<strong>有照片或录音</strong></li>\n  <li>此观察<strong>并非人造物</strong></li>\n</ul>\n<p>\n  在以下情形时，观察变更为<strong>\"研究级别\"</strong>：\n</p>\n<ul>\n  <li>\n    %{site_name}<strong>的社区同意物种级别或更低的ID</strong>，即，超过2/3的分类者同意该分类单元时\n  </li>\n</ul>\n<p>\n  如果上述条件未得到满足或社群不同意，观察将恢复至<strong>“随意”</strong>\n</p>\n<ul>\n  <li>\n    <strong>位置看起来不准确</strong>（例如海洋中的猴子，办公楼的河马等）\n  </li>\n  <li>\n    <strong>生物体并不是野生/纯天然的</strong>（例如，由人类或智能外星人驯化或培养）\n  </li>\n  <li>\n    观察<strong>没有提供有机体的证据</strong>，例如，景观、水景、岩石等的图像\n  </li>\n  <li>\n    观察<strong>没有提供最近（约100年内）是有机体的证据</strong>（例如化石，但是足迹、粪便和枯叶都可以）\n  </li>\n  <li>\n    观察不再需要ID<em>并且</em>社区已有ID是更高级的家族\n  </li>\n  <li>\n    观察者选择退出社区ID，并且社区ID分类单元并非是与观察者ID相关的分类单元的祖先或后代\n  </li>\n</ul>\n<p>\n  如果这不够复杂，还有一些系统获得投票的情形：\n</p>\n<ul>\n  <li>\n    如果在包含该观察的最小的县、州或国家级行政单位中存在至少10个属或更低的其他观察，并且其中80％或以上被标记为非野生/非纯天然，则系统将投票认为此观察不是野生/纯天然的。\n  </li>\n</ul>",
        "score_desc": "得分=累积计数/（累积计数+不一致计数+祖先意见分歧）"
      }
